// Replaces the text between the supplied start and end delimiters. If inclusive = true, the delimiters are also replaced. 
// Example: startDelimiter as "<<", endDelimiter as ">>" and replaceText as "replacetext" from text "<<thistext>>" returns "replacetext" with inclusive = true and "<<replacetext>>" with inclusive = false.

var matchText = GetTextBetweenMatchedDelimiters(startDelimiter, endDelimiter, text, includeDelimiters);
if(matchText.Length > 0)
{
